import React from 'react';
import ArticleCardWrapper, {
    Title,
} from './ArticleCard.style';

const ArticleCard = ({ className, data, buttonText }) => {
    let price, pricingPlan;

    return (
        <ArticleCardWrapper className={className}>
            <Title>{data.title}</Title>
        </ArticleCardWrapper>
    );
}

export default ArticleCard;
